		$("#accountWarningAlertText").addClass('noDisplay');
		$("#accountErrorAlertText").removeClass('noDisplay');
		$("#accountSuccessAlertText").addClass('noDisplay');
		$(".eligblityCriteria").fadeOut(500, function() {
		    $(this).addClass("noDisplay");
		});
